import React, {useRef, useEffect} from "react";
import { SubMenuListItem } from "./SubMenuListItem";


export function SubMenuList({subMenu}){
    const menu = useRef()

    let classname = "full-width menu-principal sub-menu-options";
    
    var toogleMenu = ()=> {
        menu.current.className.toggle("sub-menu-options-show"); 
    };

    useEffect(()=>{
        toogleMenu();
    },[])

    if(subMenu){
        return (
            <ul ref={menu} className={classname}>
                {subMenu.map((subMenuItem,index) =>(<SubMenuListItem key={index} menuSubItem={subMenuItem}/>))}
            </ul>
        )
    }
}
